import React from "react";

export default class CardsContainer extends React.Component{
    state = {
        events: []
    }

    componentDidMount(){
        fetch(`http://localhost:4000/Events`)
        .then(resp => resp.json())
        .then(events => this.setState({events: events}))
    }
    render(){
        return (
            <div>
                <h1>Some text</h1>
                {this.props.stocks.map(stock => <Card stockCard={stock} key={stock.id} handleStock={this.props.buyStock}/>)}
                <a>More info</a>
            </div>
        );
    }
}
